import React from "react";
import { useParams } from "react-router-dom";

const EventDetailPage = () => {
  const params = useParams();
  return (
    <div>
      <h2>EventDetailPage</h2>
      <p>{params.id1}</p>
    </div>
  );
};

export default EventDetailPage;
